content:
가라 김발목 &gt;~&lt; 
소설이 그만큼 특별한거죠 ~ 
대박나세요 ^^

참....응원하고 싶은데 양부모님과의 관계도 있으니...;;;;;;;
이래서 난 이사랑 반댈세 의견도 좀 있었던 것 같아요
두 사람이 솔직한 마음을 알아채도록 월주님이 도와주실라나요....??

아니 사실 근데 얼굴 일그러진다고 안 울고 대사 입힐 거라고 몇 컷 놓치고.. 그게 배우인가요..;;

빨리 성우 없는 시대가 와서 연기력 없는 배우 물갈이 되고 장미가 빼어나게 예쁘진 않아도 특색있는 마스크에 뛰어난 연기력으로 배우가 되었으면 좋겠네요

후시 녹음 안 하는 영화 몇 년도에 나오나요????

어쩜 이런 스토리를 다 쓰시고ㅠㅠ
 인물들 연계에 너무너무 잘 보고 있어요&gt;
작가님 늘 건강하시고 좋은 작품 그려주셔요♡♡♡♡

장미방에 들어온 청룡이 장수고 
둘이 어떤 인연이 될지 기대되네요 ^^ 
장미야 실망하지마 ~ &gt;~&lt;

이번화는 저 같이 노력보다는 운에 맡기는 
사람에게 &quot;그럼안돼요~// 장미처럼 주어진 시간을 멋지게 쓰세요//&quot;
라고 작가님이  말씀해주는 것 같아요~ ㅠ

어머니는 말씀하셨다죠. &quot;지금 충실해야 해. 어떤 역을 맡더라도 지금에 충실하면 모든 연기는 빛을 발하지.&quot;
동생은 얘기했어요. &quot;동네 바보들 떠드는 소리는 신경 쓰지 마.&quot;
아버지는 말씀하셨죠. &quot;자신을 소중히 여기 자신을 지켜내는 용기&quot;를 가지라고요.
장수는 따뜻한 말그릇을 가진 배우로 성장하고 있습니다.
곧 대중의 태성이 될 예정이니 coming soon!

어제 보고 오늘 아침에 또 보는데 

&#x27;세상과 싸워 승리하며 앞으로 나아가는 용기를 말하는 것이 아니라 자신을 소중히 여기며 자신을 지켜내는 용기야. 모든 걸 잘할 필요 없다.&#x27;

이 부분이 ㅠㅠ 힘을 주면서도 그렇지 못했던 내 자신에게 미안해서 눈물이 나요ㅠㅠ 작가님 최고

그 시절 용어와...나쁜 이미지 가진 
따돌림  보다 &#x27;구박 받고&#x27;
단어가 훨씬 좋은 것 같습니다만.

쌍갑포차 열기전 마음준비운동
&quot;오늘은 울지 말아야지~~!&quot;

또 울어버렸어요ㅜㅜㅜ

꺅 나비랑 옆에 치즈까지 꼬냉쓰 두마리잖아요&gt;.&lt;
약과편도 정말 재밌고 감사히 잘 봤습니다.
보면서 이전화들도 함께 재결제하며 보게되는 현실 ㅜㅜㅋㅋ

&#x27;&#x27;여봐라 이 말많은 것을 당장 하옥하라&#x27;&#x27;
&#x27;&#x27;약과를 진어하오서&quot; 

아니..두분 이렇게 역할놀이하시면서 그 긴 세월 놀으셨던거에요?ㅋㅋ

이것 보고 41회 다시 보고 왔어요..
최상궁 자기 딸인데도 죽게 내버려 두다니....
딸보다 명예가 좋은가 봐요..;;;;;

&quot;행복한 얼굴로 하나, 둘, 셋...&quot; 
작가님,
2019년 마지막 밤 행복한 얼굴 지을 수 있게 해주셔서 감사드려요.

이거슨 에로계의 거장 배해수 작가님의
 &#x27;불타는 물레방아야&#x27; 를 뛰어넘는 또하나의수작! 
&#x27;손만 잡고 잘테야,  딴 건 잡지마!&#x27;

꺄아아아앙 너무 좋아요 ....&gt;.&lt;

제 인생웹툰 쌍갑포차 드라마 제작기사 봤어요
작가님이 더 흥하시길 도비들이 응원합니다~!!!!

예전에 영진 씨가 했던
&quot;옥란이가 날 많이 보고 싶어할텐데...&quot;
이 말은 사별한 부인이 잠들어 있는 무덤을 이야기하는 것이었군요...추리가 맞을까요?

뭘입어도 이쁘다니 ~ 
&gt;~&lt; 
아우 우리 강형사님 맘에들어 어쩌질 못하네요

영화 포스터의 주인공 이름이 틀렸네요.
작가님이 젊은 분인 걸 이걸로 알겠슴다. ^^;
클라크 게이블과 비비안 리입니다.

아이고 핑크핑크 꽃이 피었네요~~

퍼즐 하나하나가 이리 잘들 들어맞으니 앞뒤로 보는 맛이 있네요~

또 정주행하러가야하나;;

반값된 귀신들린집 사서 두세배 뻥튀기해서 팔아 집안을 일으키자, 오목아!!!

예나 지금이나 집으로 재산불려야하나봐요;;;
하긴 요새는 그것도 힘들다던데... 
내 집은 어딨을까요ㅜㅜ..;;;

늘 좋은 내용 감사드려요^^~
저기  근데 작가님
뜬금없지만 편집에 쭈꾸미가 아니고 주꾸미가 표준어 입니다.^^;
많이들 그렇게 쓰시기도하고 저도 그리 알고있었는데 제가 요새 국어 자격증 공부하느라 눈에 띄어가지고...
ㅎㅎ죄송해요^^;
수고하세요.

제희님, 건무님 허리를 잡아요잡으라구요!!
미별왕의 양은 하늘도 빨리 날아갈 수 있어 잘못하다가 떨어질 수도 있어요~~~
아아아아아~~ 저 순진한 냥반들을 어떡함 조와 &gt;_&lt;

제희선녀님 건무차사와 행복하시길!
저도 이번 선녀님 꽃 꽂는 모습에 반했습니다. ㅎㅎㅎ 저 위치에 저런 기세로 꽂는 거군요. 두근두근 ㅋㅋㅋ
건무차사 같은 분들이 지금의 왼갖 흉한 일 하는 한국 남자들 교화시켰으면 좋겠네요. 고운 일 하는 남자만 삼신님, 월주신님 등이 굽어살펴 주시고요. 하긴 오히려 단호히 혼내 주시는 건 월주신님이나 삼신님이 더 어울리시려나요. &#x27;쓸어 버려라.&#x27;
